-- Создание хранимых процедур

GO
CREATE PROCEDURE AddLineInOrderDetails
	@order_id int,
	@product_id int,
	@count int
AS
	INSERT INTO OrderDetails(order_id, product_id, [count]) VALUES(@order_id, @product_id, @count)
GO

GO
CREATE PROCEDURE UpdateOrderCost
	@order_id int,
	@cost int
AS
	UPDATE [Order]
	SET cost = @cost
	WHERE order_id = @order_id
GO

GO
CREATE PROCEDURE GetOrderID
	@user_id int,
	@datetime_of_form datetime,
	@order_id int OUT
AS
	SELECT @order_id = order_id 
	FROM [Order] 
	WHERE user_id = @user_id AND datetime_of_form = @datetime_of_form
Go

GO
CREATE PROCEDURE FormOrder
	@user_id int,
	@datetime_of_form datetime,
	@datetime_of_payment datetime = null,
	@paid bit = 0,
	@cost int = 0
AS
	INSERT INTO [Order](user_id, datetime_of_form, datetime_of_payment, paid, cost) VALUES(@user_id, @datetime_of_form, @datetime_of_payment, @paid, @cost);
GO

GO
CREATE PROCEDURE DeleteProductFromBasket
	@user_id int,
	@product_id int
AS
	DELETE Basket
	Where Basket.user_id = @user_id AND Basket.product_id = @product_id
GO

GO
CREATE PROCEDURE DROPLINKS
	@TABLENAME varchar(MAX)
AS
	DECLARE @REQ VARCHAR(MAX);
	SELECT 
		@REQ =
		'ALTER TABLE ' +  OBJECT_SCHEMA_NAME(k.parent_object_id) +
		'.[' + OBJECT_NAME(k.parent_object_id) + 
		'] DROP CONSTRAINT ' + k.name
	FROM sys.foreign_keys k
	WHERE referenced_object_id = object_id(@TABLENAME)
	EXEC(@REQ);
GO

GO
CREATE PROCEDURE AddUser
	@email varchar(256),
	@password varchar(max),
	@name varchar(max),
	@surname varchar(max) = '',
	@middle_name varchar(max) = '',
	@photo varbinary(max) = NULL,
	@phone_number varchar(12) = NULL,
	@role char(1) = 'U'
AS
	INSERT INTO [User](email, [password], role_id) VALUES(@email, @password, @role);
	INSERT INTO UserPersonalInf(id, name, surname, middle_name, photo, phone_number)
		VALUES(
				(
					SELECT id FROM [User] WHERE email=@email
				), 
				@name, @surname, @middle_name, @photo, @phone_number);
GO

GO
CREATE PROCEDURE AddProductToBasket
	@user_id INT,
	@product_id INT,
	@count INT,
	@addDate datetime
AS
	INSERT INTO Basket(user_id, product_id, count, add_date) 
		VALUES(@user_id, @product_id, @count, @addDate);
GO

GO

CREATE PROCEDURE UpdateProductCountInBasket
	@user_id INT,
	@product_id INT,
	@new_count INT
AS
	IF EXISTS(SELECT * FROM Basket WHERE user_id = @user_id AND product_id = @product_id)
	BEGIN
		UPDATE Basket
			SET count = @new_count
		WHERE user_id = @user_id AND product_id = @product_id
	END
GO

